import React from "react";
import ReactDOM from "react-dom";

const TodpList = () => {
    return(
        <ul>
            <li>Learn React</li>
             <li>Build Awesome App</li>
        </ul>
    );
};

const AppHeader = () => {
    return <h1>My Todo List</h1>;
};

const SearchPanel = () => {
    return <input placeholder="search" />;
};

const el = (
    <div>
        <AppHeader />
        <SearchPanel />
        <TodpList />
    </div>
);


ReactDOM.render(el, 
    document.getElementById('root'));
